import MethodPage from "../MethodPage/MethodPage";
import classes from "./SetPage.module.css";
import Sidebar from "../../components/Sidebar/Sidebar";
import { Fumen } from "../../components/Fumen/Fumen";

interface SetPage {
    pc: number;
}
const sets = [
    {
      title: "Algebruh's 2nd",
      pfp : "https://cdn.discordapp.com/avatars/554411603609518095/161d78efc00421e3a4e62425221f5311.webp?size=40",
      author: "algebruh",
      methods: "29/35",
      setups: 40,
      cover: "100%",
      description: "This set is organized to minimize difficulty while maintaining reliability and usefulness."
    },
    {
      title: "2nd 100% T",
      pfp: "https://cdn.discordapp.com/avatars/402657980517974026/1f90c2454cdd8f7ad0111a83e66fc55a.webp?size=48",
      author: "mkjl",
      methods: "21/35",
      setups: 882,
      cover: "0.11%",
      description: "This set contains every 2nd PC that has a 100% chance of saving into T 3rd."
    },
    {
        title: "Theoretical 2nd",
        pfp: "https://cdn.discordapp.com/avatars/427589146295664667/bfe2236004af8a55971181f3e629c4f3.webp?size=32",
        author: "xp3",
        methods: "342",
        setups: 352,
        cover: "100%",
        description: "We know now that theoretically, T>I>J/L>O>S/Z for 3rd PC. We don't know how, but what would 2nd look like if we did?"
    },
    {
        title: "Beginner 2nd",
        pfp: "",
        author:"10Penta",
        methods: "",
        setups: 0,
        cover: "0%",
        description: "This is a 2nd PC doc truly oriented towards beginners just starting out and aiming to achieve their first 5-10PCs."
    }
  ];

const SetPage = ({ pc }: SetPage) => {
    document.title = `${pc}${
        ["", "st", "nd", "rd", "th", "th", "th", "th"][pc]
    } PC`;

    const seconds = [];
    for (let i = 0; i < 7; i++) {
        for (let j = i + 1; j < 7; j++) {
            for (let k = j + 1; k < 7; k++) {
                for (let l = k + 1; l < 7; l++) {
                    seconds.push(
                        "TIJLOSZ"[i] +
                            "TIJLOSZ"[j] +
                            "TIJLOSZ"[k] +
                            "TIJLOSZ"[l]
                    );
                }
            }
        }
    }

    return (
        <div className={classes.hi}>
            <Fumen fumen="v115@9gilwhDeR4glRpwhCeR4wwg0RpwhBeBtxwi0whCeBt?wwJeAgH"></Fumen>
            {seconds.map((second) => (
                <div className={classes.container}>
                    {second}
                </div>
            ))}
            <Sidebar title={document.title} sets={sets}>
                {sets.map((set, index) => (
                    <div key={index} className={classes.setCard}>
                        <h2 className={classes.setTitle}>{set.title}</h2>
                        <p className={classes.setDescription}>{set.description}</p>
                        <div className={classes.setAuthor}>
                            <img src={set.pfp} alt="" />
                            <a>{set.author}</a>
                        </div>
                        <hr />
                    </div>
                ))}
            </Sidebar>
        </div>
    );
};

export default SetPage;
